import React from 'react'
import Form from './Form'
function Contact(){
    const flex={
        display:'flex',
        flexWrap:'wrap'
        
            }
    return(
        <>

<main style={flex}>
    <div id='form' style={{display:'none',marginTop:'100px'}} >
                 <Form/></div>
            <div className='hari'>
                <i class='fa fa-facebook-square'/>
                <i class='fa fa-facebook-square'/>
                <i class='fa fa-facebook-square'/>
             </div>
            </main>
        </>
    );
}
export default Contact;
